import React from 'react'
import { View } from 'react-native'

const CardsRow = (props) => {
    return(
        <View style= {{flex: 1}}>
            {props.cards.map(card => <Card onClick={() => props.onClick(card)} isFlipped={card.isFlipped} key={card.id} {...card}/>)}
        </View>
    )
}
export default CardsRow
